import React from 'react'
import '../Styles/Feature.css'
import '../App.css'
import Feature from './Feature'

export default function Features(props) {

    return (
        <div className="Features">
            <Feature
                reverse={false}
                img={"https://tractive.com/static/images/sections/Tractive-GPS-IKATI-Tractive-GPS-DOG-2560.jpg"}
                color={"#f5f6f8"}
            >
                <div>
                    <div className="feature-intro flex-col">
                        <div className="feature-title">
                            <strong>Tractive products</strong>  are robust and easy to use
                        </div>
                        <div className="feature-text">
                            Bất kể khi nào hoặc ở đâu, hãy luôn kết nối với chó hoặc mèo của bạn. Với vòng cổ GPS, bạn có thể thấy dấu vết chính xác của người bạn bốn chân của mình. Nhờ hàng rào ảo tích hợp (geofence), Tractive sẽ thông báo cho bạn ngay lập tức trong trường hợp con mèo hoặc con chó của bạn rời khỏi khu vực an toàn được xác định trước. Chỉ cần gắn thiết bị theo dõi thú cưng GPS vào cổ áo và yên tâm.
                        </div>
                    </div>
                </div>
            </Feature>
            <Feature
                reverse={true}
                img={"https://tractive.com/static/images/sections/Tractive-DOG-LIVE-Tracking-2560.jpg"}
                color={"linear-gradient(to right, #00a5e1, rgba(0,127,200,0.5)),linear-gradient(#007fc8, #007fc8)"}
            >
                <div>ccccc</div>
            </Feature>
            <Feature
                reverse={false}
                img={"https://tractive.com/static/images/sections/Tractive-DOG-vani-2560.jpg"}
                color={"#f5f6f8"}
            >
                <div>ccccc</div>
            </Feature>
        </div>
    )
}
